define({"topics" : [{"title":"Data Preview Overview","shortdesc":"\n            <p class=\"shortdesc\">You can preview data to help build or fine-tune a pipeline. When you preview data, the             <span class=\"ph\">Data Collector</span>         passes data through the pipeline and allows you to review how the data passes through each         stage. \n            </p>\n         ","id":"concept_jtn_s3m_lq","href":"datacollector\/UserGuide\/Data_Preview\/DataPreview_Title.html#concept_jtn_s3m_lq","menu": {"hasChildren":true,},"tocID":"concept_jtn_s3m_lq-d46e111579","next":"concept_jtn_s3m_lq-d46e111579",},{"title":"Data Collector UI - Preview Mode","shortdesc":"\n            <p class=\"shortdesc\">You can use <span class=\"ph\">Data Collector</span> to view how     data passes through the pipeline.\n            </p>\n         ","id":"concept_l4q_pbl_sq","href":"datacollector\/UserGuide\/Data_Preview\/DataPreview_Title.html#concept_l4q_pbl_sq","menu": {"hasChildren":true,},"tocID":"concept_l4q_pbl_sq-d46e111799","next":"concept_l4q_pbl_sq-d46e111799",},{"title":"Previewing a Single Stage","id":"task_cxd_p25_qq","href":"datacollector\/UserGuide\/Data_Preview\/DataPreview_Title.html#task_cxd_p25_qq","menu": {"hasChildren":false,},"tocID":"task_cxd_p25_qq-d46e111970","topics":[]},{"title":"Previewing Multiple Stages","shortdesc":"\n            <p class=\"shortdesc\">You can preview data for a group of linked stages within a pipeline.</p>\n         ","id":"task_svd_dvz_sq","href":"datacollector\/UserGuide\/Data_Preview\/DataPreview_Title.html#task_svd_dvz_sq","menu": {"hasChildren":false,},"tocID":"task_svd_dvz_sq-d46e112063","topics":[]},{"title":"Editing Preview Data","shortdesc":"\n            <p class=\"shortdesc\">You can edit preview data to view how a stage or group of stages processes the         changed data. Edit preview data to\n               test for data conditions that might not appear in the         preview data set.\n            </p>\n         ","id":"task_nyy_13l_5s","href":"datacollector\/UserGuide\/Data_Preview\/DataPreview_Title.html#task_nyy_13l_5s","menu": {"hasChildren":false,},"tocID":"task_nyy_13l_5s-d46e112169","topics":[]},{"title":"Editing Properties","shortdesc":"\n            <p class=\"shortdesc\">In data preview, you can edit stage properties to see how the changes affect preview         data. For example, you might\n               edit the expression in an Expression Evaluator to see how the         expression alters data. \n            </p>\n         ","id":"task_dyy_k3l_5s","href":"datacollector\/UserGuide\/Data_Preview\/DataPreview_Title.html#task_dyy_k3l_5s","menu": {"hasChildren":false,},"tocID":"task_dyy_k3l_5s-d46e112285","topics":[]}]});